article_content:
맘에들어요
근데 배송이 엉망진창이네요
옆에 다 까져서 왔어요 짜증나죽겠음 ;

생각보다튼튼한것같아요!!걱정을많이했는데괜찮아요!!엄마주문해드렸는데~~좋아하시네요~~이쁘다네요!!상판도테두리마감한제품같은거면더좋을것같아요~~밥먹다찍어서모서리부분만찍었어요;;;ㅋ
그리고상이일어난다하시는분들이계셔서~~아마물이틈사이로들어가서나무가물을흡수해서들고일어난것같아요;;
그래서엄마보고물쏟거나하면흡수하기전에바로닦아라고알려드렸어요~~^^

오염심함 중고온줄알았음 ;
닦이지도 않고 오염부분 사진보다 더 더 있음
검수 안하고 보내시는지ㅜ

다깨져서 왔네요; 어디다 뒹굴면서 온건지...부스러기가;;;
그리고 저는 설명서가 없어서 고뇌하면서 조립했어요;;;
에휴 역시 싼값에 사는건가...

좋네요~!!!
조립도 생각보다 간단하고..
참. 처음엔 설명서가 있는줄 알았는데 없어서 잠간 당황했었네요^^;;;

조립은 처음이라...^^;;
처음에는 약간 헤매면서.. 조립했어요!
구분 잘 하셔서 해야 할것 같아요! 저는 처음에 잘못 놔두고 조립했다가 가시 풀었다는...;;;
만들어 놓고 보니 뿌듯하고 만족합니다!!
두개 샀는데.. 하나는 세로로 하나는 가로로 놔두니 예쁜것 같더라구요 ~~

가격대비 만족도 높습니다.
다만 여성이 조립하기엔 힘드네요^^;;
전동드라이버가 있다면 굉장히 수월했을거에요

서랍 옆면 나무가 좀 .. 부서져서 온거랑 조립 쬐끔 빡쎈거빼면 이뻐요
21.03.29도착

2021.04.14 수정) 옆면 나무가 부셔졌던게 문제됐네요 쓴지 얼마나 됐다고 다 빠져버리죠. 디자인만 신경쓰시느라 내구성이 엉망이네요. 이쁜데 서랍 1개씩 별도판매하셔야겠어요. 버리는 스티커값이나 더 들겠네요 이뻐서 좋았는데 너무 아쉽네요. 그래도 이뻐서 다시 살까고민했는데 그사이에 가격이 올랐네요 에휴;;;;;

상품평이 좋아서구매했는데 다이소만도 못해요
역시 상품평만 믿고사는건 아닌가봐요;;
검수도안하고 물건보내시는건가요;;
곰팡이 천국입니다ㅎ ;;

화면이랑 똑같은 아이가 왔네요! 이뻐요! 마냥 새하얀 색일까봐 살짝 걱정했는데 무늬가 있어서 좋았어요. 원했던 자리에 쏙 들어가는 사이즈여서 맘에 들어용!
사진에서 보듯이 안쪽에.. 밖에서 찍힌 자국 같은게 있는데... 교환하기 귀찮아서 그냥 쓸래요;;
많이 파세용~

딱 가격만큼보임.
박스에서 꺼내기 뭐가 그리 시커멓게 묻어있던지;;
곰팡이도 살짝있고..원래는 방에서 쓰려고 했으나..베란다나 전실로 빼놓고 쓰려함.
